    <style>
      body {
        font-family: Arial, sans-serif;
        background-color: #f4f4f9;
        padding: 20px;
      }
      h2 {
        text-align: center;
        color: #333;
      }
      .form-group {
        margin-bottom: 15px;
      }
      label {
        display: block;
        margin-bottom: 5px;
        color: #333;
      }
      input {
        width: 100%;
        padding: 10px;
        border: 1px solid #ccc;
        border-radius: 4px;
      }
      #register-button {
        width: 100%;
        padding: 10px;
        background-color: #007bff;
        color: white;
        border: none;
        border-radius: 4px;
        cursor: pointer;
      }
      #register-button:hover {
        background-color: #0056b3;
      }
      button {
        margin-top: -11px;
        margin-left: -10px;
        padding: 10px 20px;
        background-color: #4a90e2;
        color: #ffffff;
        border: none;
        border-radius: -5px;
        cursor: pointer;
        transition: background-color 0.3s ease-in-out;
      }
    </style>
  </head>

  <body>
    <h2>ユーザー登録</h2>

    <div class="form-group">
      <label for="username">ユーザー名</label>
      <input type="text" id="username" placeholder="ユーザー名を入力してください">
    </div>

    <div class="form-group">
      <label for="email">メールアドレス</label>
      <input type="email" id="email" placeholder="メールアドレスを入力してください">
    </div>

    <div class="form-group">
      <label for="password">パスワード</label>
      <input type="password" id="password" placeholder="パスワードを入力してください">
    </div>
    <button id="register-button">アカウント作成</button>

    <p>既にアカウントをお持ちですか？ <a href="login.html">ログインはこちら</a></p>
  </body>
